import React, { FC } from 'react';

interface ContentProps {
  parts: {
    name: string;
    exercises: number;
  }[];
}

const Content: FC<ContentProps> = props =>
  props.parts.map((item, index) => (
    <p>
      {item.name} {item.exercises}
    </p>
  ));
export default Content;
